import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';

import Login from './components/pages/loginScreen/Login';
import PatientPersonalDetails from './components/pages/patientScreen/PatientPersonalDetails'
import SearchPage from './components/pages/SearchPage';
import DashBoard from './components/pages/DashBoard';


class App extends React.Component {

  render(){
    return (
      <Router>
        <Route exact path ="/" component = { Login}/>
        <Route exact path = "/personalDetails" component ={PatientPersonalDetails} />
        <Route exact path ="/dashboard" component = {DashBoard} />
      </Router>

    );
  }

}

export default App;
